import styled from "styled-components";

function MovieDetail() {
  return (
    <Container>
      <Wrapper>
        <ImgBox></ImgBox>
        <ContentBox>
          <Title>
            영화제목
            <span>(2023)</span>
          </Title>
        </ContentBox>
      </Wrapper>
    </Container>
  );
}

const Container = styled.div`
  padding: 30px 0;

  background: #eee;
`;

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  max-width: 900px;
  margin: 0 auto;
`;

const ImgBox = styled.div`
  width: 300px;
  height: 450px;
  background-color: red;
`;

const ContentBox = styled.div``;

const Title = styled.h2`
  font-size: 1.3rem;
  font-weight: 700;

  span {
    font-size: 1.2rem;
    font-weight: 500;
  }
`;

export default MovieDetail;
